// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DocumentSigner {
    struct Document {
        bool exists;
        address creator;
        string title;
        bytes32 contentHash;
        mapping(address => bool) hasUserSigned;
        address[] signers;
    }

    mapping(bytes32 => Document) public documents;

    event DocumentSaved(bytes32 indexed documentId, address indexed creator, string title);
    event DocumentSigned(bytes32 indexed documentId, address indexed signer);

    modifier documentExists(bytes32 documentId) {
        require(documents[documentId].exists, "Document does not exist");
        _;
    }

    function saveDocument(
        bytes32 documentId,
        string calldata title,
        bytes32 contentHash
    ) external {
        require(bytes(title).length > 0, "Title cannot be empty");

        Document storage doc = documents[documentId];

        // If document doesn't exist, initialize it
        if (!doc.exists) {
            doc.exists = true;
            doc.creator = msg.sender;
            doc.title = title;
            doc.contentHash = contentHash;
            emit DocumentSaved(documentId, msg.sender, title);
        } else {
            // If document exists, only allow creator to update it
            require(doc.creator == msg.sender, "Only creator can update document");
            doc.title = title;
            doc.contentHash = contentHash;
        }
    }

    function signDocument(bytes32 documentId) external documentExists(documentId) {
        Document storage doc = documents[documentId];
        require(!doc.hasUserSigned[msg.sender], "User has already signed this document");
        
        doc.hasUserSigned[msg.sender] = true;
        doc.signers.push(msg.sender);
        
        emit DocumentSigned(documentId, msg.sender);
    }

    function getDocument(bytes32 documentId) external view documentExists(documentId) returns (
        address creator,
        string memory title,
        bytes32 contentHash,
        address[] memory signersList
    ) {
        Document storage doc = documents[documentId];
        return (
            doc.creator,
            doc.title,
            doc.contentHash,
            doc.signers
        );
    }

    function hasUserSigned(bytes32 documentId, address user) external view documentExists(documentId) returns (bool) {
        return documents[documentId].hasUserSigned[user];
    }

    function getSigners(bytes32 documentId) external view documentExists(documentId) returns (address[] memory) {
        return documents[documentId].signers;
    }
}

